import "./styles.css";
import { Canvas } from "@react-three/fiber";
import { useLoader } from "@react-three/fiber";
import { Environment, OrbitControls } from "@react-three/drei";
import { FBXLoader } from "three/examples/jsm/loaders/FBXLoader";
import { Suspense } from "react";

const Scene = () => {
  const fbx = useLoader(FBXLoader, "ship.fbx");
  console.log("sdhgsdgs");
  return <primitive object={fbx} scale={0.006} position={[-10,-5,0]}/>;
};

const Scene1 = () => {
  const fbx = useLoader(FBXLoader, "gun.fbx");
  console.log("image 2");
  return <primitive object={fbx} scale={0.01} position={[10,100,0]}/>;
};

export default function App() {
  return (
    <div className="App">
      <Canvas camera={{ fov: 75, near: 0.1, far: 1000, position: [200, 100, 500] }}>
        <Suspense fallback={null}>
          <Scene />
          <Scene1 />
          <OrbitControls />
          <pointLight position ={[100, 100, 100]} light={50}/>
          <Environment preset="sunset" background />
        </Suspense>
      </Canvas>
    </div>
  );
}
